import React from 'react';
import './SetupButton.css';

function SetupButton() {
  const handleClick = () => {
    console.log('Setup clicked');
  };

  return (
    <button className="setup-button" onClick={handleClick}>
      <svg className="button-icon" width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M10 12.5C11.3807 12.5 12.5 11.3807 12.5 10C12.5 8.61929 11.3807 7.5 10 7.5C8.61929 7.5 7.5 8.61929 7.5 10C7.5 11.3807 8.61929 12.5 10 12.5Z" fill="white"/>
        <path fillRule="evenodd" clipRule="evenodd" d="M10 2.5L12.5 4.5L15.5 3.5L16.5 6.5L18.5 9L16.5 11.5L16.5 14.5L14.5 17L11.5 16.5L9 18.5L6.5 16.5L3.5 17.5L2.5 14.5L0.5 12L2.5 9.5L2.5 6.5L4.5 4L7.5 4.5L10 2.5ZM10 4.5L8 6L5.5 5.5L4.5 7.5L3 10L4.5 12.5L4.5 15L6 16.5L8.5 16L10.5 17.5L13 16L15.5 16.5L16.5 14.5L18 12L16.5 9.5L16.5 7L15 5.5L12.5 6L10 4.5Z" fill="white"/>
      </svg>
      <span className="button-text">Установка и настройка</span>
      <span className="button-platform">для iOS</span>
    </button>
  );
}

export default SetupButton;
